Starring: Anikka Albrite , Belle Noire , Marie McCray

There Are A Million Ways To Get Laid In The West! City Girls Welcome!
City girl Kelly Rodgers (AVN Winner Anikka Albrite) thinks she's just struck gold when she inherits the Broke Twig Ranch. But she discovers the 'ranch' is actually a wild west Bordello, where comely corseted babes (award winners Maddy O'Reilly and Marie McCray) keep every customer satisfied. When whip-cracking rustler Jordan Daniels (Tommy Gunn) and the corrupt Sheriff try to take the bordello for themselves, Kelly`s got to find the buck-wild cowgirl within... and take these varmints on one hell of a ride!

